sample.data = sample.data.map((sampleData) => {
	return sampleData.map((dataObj) => {
		const year = Math.floor(Math.random() * (2023 - 1900) + 1900);
		const month = Math.floor(Math.random() * (12 - 1) + 1);
		const day = Math.floor(Math.random() * (29 - 1) + 1);
		const date = new Date(year, month, day);
		return {...dataObj, date: date.toISOString()};
	});
});

const validateDateAndConvertToISO = (dataContainer) => {
	if (dataContainer)
		return dataContainer.data.map((singleFile) => {
			return singleFile.map((dataObj) => {
				for (let key in dataObj) {
					if (moment(dataObj[key], dataContainer.config.format, true).isValid()) {
						dataObj[key] = moment(dataObj[key], true).format(moment.ISO_8601).toString();
					}
				}
				return dataObj;
			});
		});
};
